import { useState } from "react"
import { SimulationParamContainer } from "./SimulationParamContainer";

export function SimulationColumn(props) {

    const [simList, setSimList] = useState([]);

    return (
      <ul className="w-3/5 px-2 py-8 flex flex-col items-center justify-center" onClick={() => setSimList(simList + <SimulationParamContainer />)}>
        {props.children}
      </ul>
    )
  }
